function Cart(props) {
    const { cartItems } = props;

    // const cartItemsArray = Object.values(cartItems);
    // console.log(cartItemsArray);

    const cartItemsArray = [{name: 'test', price: 1, amount: 1}];

    return (
      <div>
        <h2>Cart Items</h2>
        {cartItemsArray.map((item, index) => (
          <div className="cart-item">
            <p>{item.name}</p>
            <p>{item.price}</p>
            <p>{item.amount}</p>
          </div>
        ))}
      </div>
    );
  }

  export default Cart;
